(2, '7c81ceec', 'Solo Parent', 'A woman who gives birth as a result of rape and other crimes against chastity even without a final conviction of the offender, provided that mother keeps and raises the child; Parent left solo or alone with the responsibility of parenthood; Unmarried mother/father who has preferred to keep and rear her/his child/children instead of having others care for them or give them up to a welfare institution; Any other person who solely provides parental care and support to a child or children;Any family member who assumes the responsibility of head of family as a result of the death, abandonment, disappearance or prolonged absence of the parents or solo parent (RA 8972)'),
(3, '7c81d234', 'Person With Disability (PWD)', 'Those suffering from restriction of different abilities, as a result of a mental, physical or sensory impairment, to perform an activity in the manner or within the range considered normal for a human being (RA 7277)'),
(4, '7c81d3d8', 'Indigenous People (IP)', 'Group of people or homogenous societies identified by self­ascription and ascription by others, who have continuously lived as organized community on communally bounded and defined territory, and who have, under claims of ownership since time immemorial, occupied, possessed and utilized such territories, sharing common bonds of language, customs, traditions and other distinctive cultural traits (RA8371)'),
(5, '7c81d554', 'Foreign National', 'A person who is not a Philippine National. ');
